  \"2016-01-28T05:21:20.719521\",\n\t\"name\": \"maryland-housing-rehab-special-loans-program\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Special Loans Program rehabilitates
  homes of moderate income maryland homeowners across the state in cooperation with
  the Local Government agencies Types of rehabilitation include accessibility modifications
  for senior and disabled occupants, bringing electrical and/or plumbing systems to
  state and local codes, making roof and structural repairs, and in exceptional cases
  replacing an uninhabitable dwelling with a modest living structure.rnrnDISCLAIMER:
  Some of the information may be tied to the Departmentu2019s bond funded loan programs
  and should not be relied upon in making an investment decision.  The Department
  provides comprehensive quarterly and annual financial information and operating
  data regarding its bonds and bond funded loan programs, all of which is posted on
  the publicly-accessible Electronic Municipal Market Access system website (commonly
  known as EMMA) that is maintained by the Municipal Securities Rulemaking Board,
  and on the Departmentu2019s website under Investor Information. The links are:   http://www.mdhousing.org/Website/Investor/Default.aspx
